    filed as a 30-Day Post Election Report for the contribution in December to the
    AL-1 race. While trying to upload this report, however, the FEC software did not
    allow for such submission;  specifically, we received the following error:  \"The
    30S report from C00216127 filed on 01/20/2014, could not be processed because
    an incorrect ending coverage date 01/06/2014 was used for this report.  Please
    file the report with the correct ending coverage date or contact your campaign
    finance analyst for assistance at (202) 694-1130 or (800)424-9530 extension 1130.\"
    \  As the FEC is closed today and no help is available, we ask that, because there
    were no disbursements, nor receipts between 12/31/13 and 1/06/14, you please accept
    this filing wiill as the required disclosure for the AL-1 race.\n"
